('12c6da7e-81fd-42c1-8dd1-6b149c23c1d5', 23.99, 'Live Lively', 'Box of Life – Survival kit\nThis mystery box will provide 60 sachets of life-saving therapeutic food, water purification tablets for more than 15,000 litres of safe water and a thermal blanket to keep children warm and healthy.', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/6239f675-a33b-4f9e-a6da-08326f9ff82a.jpg', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/de5fb7a2-a233-498d-adfc-a13297715a6c.jpg', '1667189383', 0, 1, '2022-03-28 04:10:37', '2022-03-28 13:48:49', '63cbc64a-c746-40ac-988f-c68ff90132ed', 1),
