('6732e27a-93f1-41a2-8675-57d6e6b7dee7', 23.99, 'Enjoy Life', 'Box of Life – Vaccines set\nThis mystery box will provide essential basic vaccines for children, such as measles, tetanus and polio vaccines. An immunization schedule helps protect infants and children by providing immunity early in life, before they are exposed to potentially life-threatening diseases.', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/4558cc72-526a-401a-afd3-ac85a1fd0768.jpg', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/3f00edb8-b89b-463a-a3e2-16256d179d8e.jpg', '1667189483', 0, 1, '2022-03-28 04:12:01', '2022-03-28 13:48:41', '63cbc64a-c746-40ac-988f-c68ff90132ed', 1),
