('ea55766a-c22e-43a4-97b7-6416548e72d8', 23.99, 'Fight Together', 'Box of Life – Fight COVID-19\nThis mystery box will provide essential supplies to protect children in areas affected by COVID-19 in Thailand. This includes medical supplies and hygiene products, such as oxygen concentrators, alcohol sprays, face masks and COVID-19 rapid tests for disadvantaged children and adults.', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/0a8d1c81-9ed4-4424-8885-0937e53a49d8.jpg', 'https://ik.imagekit.io/4ntfh41xrqc/mysteryBox/1be6d77d-8c3d-4e18-8a21-36315848ee3b.jpg', '1667189244', 0, 1, '2022-03-28 04:08:22', '2022-03-28 13:48:56', '63cbc64a-c746-40ac-988f-c68ff90132ed', 1);
